    // 创建tooltip元素
    let tooltip = document.createElement('div');
    tooltip.className = 'position-tooltip';
    document.body.appendChild(tooltip);

    // 查找并处理所有符合条件的span
    function processNames() {
        // 查找所有包含操作员名字的span
        document.querySelectorAll('span[name="$viewdesc_operator$"]').forEach(span => {
            const name = span.textContent.trim();
            const position = positionMap[name];

            if (position) {
                // 包装span内容
                const wrapper = document.createElement('span');
                wrapper.className = 'name-with-position';
                wrapper.setAttribute('data-position', position);

                // 复制原有内容
                wrapper.innerHTML = span.innerHTML;

                // 替换原有span
                span.parentNode.replaceChild(wrapper, span);

                // 添加事件监听
                wrapper.addEventListener('mouseenter', showTooltip);
                wrapper.addEventListener('mouseleave', hideTooltip);
                wrapper.addEventListener('mousemove', moveTooltip);
            }
        });
    }

    // 修改showTooltip和moveTooltip函数

    // 显示tooltip
    function showTooltip(e) {
        const wrapper = e.target;
        const position = wrapper.getAttribute('data-position');

        tooltip.innerHTML = position;
        tooltip.classList.add('visible');

        // 计算位置前先获取tooltip的尺寸
        const rect = tooltip.getBoundingClientRect();
        const tooltipWidth = rect.width;
        const tooltipHeight = rect.height;

        // 计算居中位置并向上偏移
        const x = e.clientX - tooltipWidth / 2;
        const y = e.clientY - tooltipHeight - 20; // 向上偏移20px

        tooltip.style.left = `${x}px`;
        tooltip.style.top = `${y}px`;

        // 立即更新一次位置，确保显示正确
        tooltip.style.visibility = 'visible';
    }

    // 移动tooltip跟随鼠标
    function moveTooltip(e) {
        if (!tooltip.classList.contains('visible')) return;

        // 获取tooltip当前尺寸
        const rect = tooltip.getBoundingClientRect();
        const tooltipWidth = rect.width;
        const tooltipHeight = rect.height;

        // 计算居中位置并向上偏移
        const x = e.clientX - tooltipWidth / 2;
        const y = e.clientY - tooltipHeight - 20; // 向上偏移20px

        tooltip.style.left = `${x}px`;
        tooltip.style.top = `${y}px`;
    }

    // 隐藏tooltip
    function hideTooltip() {
        tooltip.classList.remove('visible');
        tooltip.style.visibility = 'hidden';
    }

    // 更新tooltip位置
    function updateTooltipPosition(e) {
        const x = e.clientX + 15;
        const y = e.clientY - 40;

        tooltip.style.left = `${x}px`;
        tooltip.style.top = `${y}px`;
    }

    // 页面加载完成后执行
    window.addEventListener('load', processNames);

    // 如果页面是动态加载的，可以使用MutationObserver
    const observer = new MutationObserver((mutations) => {
        mutations.forEach((mutation) => {
            if (mutation.addedNodes.length) {
                processNames();
            }
        });
    });

    observer.observe(document.body, {
        childList: true,
        subtree: true
    });

    // 提供API供外部调用（如果需要）
    window.namePositionTooltip = {
        addPosition: function(name, position) {
            positionMap[name] = position;
            processNames();
        },
        removePosition: function(name) {
            delete positionMap[name];
            processNames();
        },
        updateAll: processNames
    };



